import React, { useCallback, useState } from 'react';
import Link from 'next/link';
import { Menu, Input, Row, Col, Button, Form, Card } from 'antd';
import styled from 'styled-components'

const UserProfile = () => {
    return (
        <Card>
        <Card.Meta
            actions={[
                <div key="twit"></div>
            ]}
        />
        </Card>
    )
}

export default UserProfile;
